
function _observe(obj, path, level, fn) {
	if (!obj) return false;
	if (obj.hasOwnProperty('__ob')) return false;		// already observed
	
	var parentIsArray =Array.isArray(obj);
	var oldLength =obj.length;
	var paused =false;
	function onChgd(chgs) {
		var events =[];
		for (var idx in chgs) {
			var chg =chgs[idx];
			//console.log('obEvent', chg);
			if (parentIsArray && chg.name==='length') {
				oldLength =obj.length;
				continue;
			}
			var ot='';
			var sub =chg.object[chg.name];
			if (typeof sub === 'function') continue;
			if (typeof sub === 'object') {
				if (chg.type==='add' || chg.type==='update') {
					//console.log('observe sub', chg.object[chg.name]);
					//console.log('ob new obj', path?path+'.'+chg.name:chg.name);
					_observe(sub, path?path+'.'+chg.name:chg.name, level+1, fn);
				}
				if (Array.isArray(sub)) ot ='array';
				else ot ='object';
			}
			if (paused) continue;
			events.push({type:chg.type, name:chg.name, value:chg.object[chg.name], isParentArr:parentIsArray, objectType:ot, path:path?path+'.'+chg.name:chg.name, pp:path, o:chg.object, ol:oldLength});
		}
		events.length && fn({l:level, e:events});
	}
	
	Object.defineProperty(obj, '__ob', {
		value:onChgd
	});
	Object.defineProperty(obj, '__pause', {
		value:function() {
			paused =true;
		}
	});
	Object.defineProperty(obj, '__resume', {
		value:function(cb) {
			process.nextTick(function() {
				process.nextTick(function() {
					paused =false;
					cb && cb();
				});
			});
		}
	});
	Object.observe(obj, onChgd);
	//if (path) path =path+'.';
	for (var key in obj) {
		var sub =obj[key];
		if (sub && typeof sub === 'object') {
			//console.log('ob new obj', path?path+'.'+key : key);
			_observe(sub, path?path+'.'+key : key, level+1, fn);
		}
	}
}

